    @Test
    public void entradaManualSomenteAposCicloDoAnel1() throws IOException {
        inicioExecucao = new DateTime(2017, 1, 18, 10, 0, 0);

        assertTrue(controlador.isCompleto());

        Motor motor = new Motor(controlador, inicioExecucao, this);

        avancarSegundos(motor, 96);
        acionarModoManual(motor);
        avancarSegundos(motor, 300);

        assertTrue(ativacaoModoManual.get(inicioExecucao.plusSeconds(180)));
        assertTrue(desativacaoModoManual.get(inicioExecucao.plusSeconds(319)));

        assertEquals(inicioExecucao.plusSeconds(204), listaTrocaManualLiberada.get(0));
    }

